description:
Fiber Optic splitter is also called optical splitter,is one of the most important passive devices in optical fiber link,is with multiple inputs and multiple output end of the optical fiber connected devices.The fiber optic splitter by the light spligtting principle can be divided into the fused biconical taper(FBT) and planar wavegulde type(PLC).



Features:
● Low Insertion Loss,Low PDL, High Retrun Loss;
● Uniform Power Splitter
● Compact Design
● Wide Operating Wavelength
● Wide Operating Temperature
● Qualified Under Telcordia GR-1221 and GR-1209 

Application:
● Optical Fiber Communication;
● CATV;
● Optical Transmission Backbone;
● Optical Fiber Test and Measurement Systems;
● Specification 1x2 1x4 1x8 1x16 1x32 1x64 2X2 2X4 2X8 2X16 2X32 2X64
